        classes.push("ZValueDensity");
        classes.push("ZValueDensityAsset");

        const classList = document.getElementById('classList');
        const searchBox = document.getElementById('searchBox');
        const countSpan = document.getElementById('count');

        function renderClasses(filteredClasses) {
            classList.innerHTML = '';
            filteredClasses.forEach(className => {
                const div = document.createElement('div');
                div.className = 'class-item';
                div.innerHTML = `<a href="${className}.html">${className}</a>`;
                classList.appendChild(div);
            });
            countSpan.textContent = filteredClasses.length;
        }

        function filterClasses() {
            const query = searchBox.value.toLowerCase();
            if (!query) {
                renderClasses(classes);
                return;
            }
            const filtered = classes.filter(c => c.toLowerCase().includes(query));
            renderClasses(filtered);
        }

        searchBox.addEventListener('input', filterClasses);
        renderClasses(classes);
    </script>
</body>
</html>
